import "./coldChainWar.css";
import navLogo from "./navLogo.png"
import Nav from '../landingPage/Nav/navbar.js'
import blueLogo from "./blueLogo.png"
import dots from "./dots.png"




const ColdChainWar = () => {
	return(
		<div className="ColdCont flex flex-column ">

				<div className=" flex self-end ">	
					<Nav />
		      	</div>

		      	<div className="">
			      	<img className="navLogo ba" src={navLogo} alt="logo" />
			      	{/*<img className="bLogo " src={blueLogo} alt="logo" />*/}
		      	</div>

		      	<div className="dots">
		      		<img className="ba " src={dots} alt="logo" />
		      	</div>

		      	<div className="text ">
		      	</div>



	    </div>
		)
}

export default ColdChainWar;
